claims:
1. A sachet product comprising a biodegradable and/or home compostable sachet comprising a front film and a back film comprising:
a. a front middle layer and a back middle layer comprising a paper having greater than 85% cellulose content; b. a front inner layer joined to the front middle layer and a back inner layer joined to the back middle layer wherein the front inner layer and back inner layer comprises an inner layer material selected from the group consisting of polyvinyl alcohol, polybutylene succinate, polybutylene succinate adipate, polyhydroxylalkonate, polyvinylidene chloride, carnauba wax, biodegradable thermo-plastic starch, and combinations thereof; wherein front inner layer and back inner layer being permanently joined around a perimeter to form a seal, the seal forming a compartment adapted for storing a solid article comprising an open cell foam comprising:
from about 10% to about 40%, by total weight of the article, of a water-soluble polymer;
from about 5% to about 80%, by total weight of the article, surfactant selected from the group consisting of anionic surfactants, cationic surfactants, nonionic surfactants, amphoteric surfactants, zwitterionic surfactants, and combinations thereof;
a Percent Open Cell Content of from about 80% to 100%;
an Overall Average Pore Size of from about 100 μm to about 2000 μm.
